Chełchy Dzierskie is a &lt;a href="village"&gt;village&lt;/a&gt; in the administrative district of &lt;a href="Gmina%20Karniewo"&gt;Gmina Karniewo&lt;/a&gt;, within &lt;a href="Mak%C3%B3w%20County"&gt;Maków County&lt;/a&gt;, &lt;a href="Masovian%20Voivodeship"&gt;Masovian Voivodeship&lt;/a&gt;, in east-central Poland. It lies approximately north of &lt;a href="Karniewo%2C%20Mak%C3%B3w%20County"&gt;Karniewo&lt;/a&gt;, west of &lt;a href="Mak%C3%B3w%20Mazowiecki"&gt;Maków Mazowiecki&lt;/a&gt;, and north of &lt;a href="Warsaw"&gt;Warsaw&lt;/a&gt;.
